-- title:  Top down free movement demo
-- author: 00Her0
-- desc:   Top down free movement demo
-- script: lua

flr=math.floor

p={
	x=8,
	y=8
}

function solid(x,y)
		return fget(mget(flr(x/8),flr(y/8)),0)
end 

function TIC()
	cls()
	map()
	spr(2,p.x,p.y,5)
	
	pix(p.x,p.y-1,2)
	pix(p.x+7,p.y-1,2)
	
	pix(p.x,p.y+8,2)
	pix(p.x+7,p.y+8,2)
	
	pix(p.x-1,p.y,2)
	pix(p.x-1,p.y+7,2)
	
	pix(p.x+8,p.y,2)
	pix(p.x+8,p.y+7,2)
	
	Controls()
end

function Controls()

	if btn(0) and not solid(p.x,p.y-1) and not solid(p.x+7,p.y-1) then
		p.y=p.y-1
	end
	if btn(1) and not solid(p.x,p.y+8) and not solid(p.x+7,p.y+8) then
		p.y=p.y+1
	end
	if btn(2) and not solid(p.x-1,p.y) and not solid(p.x-1,p.y+7) then 
		p.x=p.x-1
	end
	if btn(3)and not solid(p.x+8,p.y) and not solid(p.x+8,p.y+7) then
		p.x=p.x+1
	end
end
